import React from 'react'
import styles from './Slot.module.scss'
import PropTypes from 'prop-types'

const Slot = ({ item, key }) => {
  return (
    <div className={ styles.root + (item.isActive ? ' ' + styles.isActive : '') } key={ key } custom-id={ key }>
      <div className={ styles.title } custom-id={ key }>{ item.title }</div>
      <div className={ styles.description } custom-id={ key }>{ item.description }</div>
    </div>
  )
}

Slot.propTypes = {
  item: PropTypes.object,
}

export default Slot
